dif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\\\"Table Normal\\\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\\\"\\\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin-top:0in;\r\n	mso-para-margin-right:0in;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0in;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\\\"Calibri\\\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\\\"Times New Roman\\\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n\r\n</p><p class=\\\"MsoNormal\\\" style=\\\"text-align:center\\\" align=\\\"center\\\"><b style=\\\"mso-bidi-font-weight:\r\nnormal\\\"><u><span style=\\\"font-size:14.0pt;line-height:115%\\\">ENGLISH LANGUAGE\r\nJSS1 HOLIDAY ASSINGMENT</span></u></b></p>\r\n\r\n<p class=\\\"MsoNormal\\\">PAGE 239 COMPREHENSION PASSAGE ( HIGHWAY ROBBERS )</p>\r\n\r\n<p class=\\\"MsoNormal\\\">PAGE 242 VOCABULARY</p>\r\n\r\n<p class=\\\"MsoNormal\\\">PAGE 243 WRITING</p>', '15', 1632152651, '15', '2021-09-20 19:44:11', '2021-09-20 19:44:11'),
(19, '10', '10', 13, 'HOLIDAY ASSIGNMENT', '<p class=\\\"MsoBodyText\\\" style=\\\"text-align:justify\\\"><font face=\\\"Cambria Math, serif\\\"><span style=\\\"font-size: 18.6667px;\\\">HOLIDAY ASSIGNMENT</span></font></p><p class=\\\"MsoBodyText\\\" style=\\\"margin-left:.25in;text-align:justify;text-indent:\r\n-.25in;mso-list:l0 level1 lfo1;tab-stops:list .25in\\\"><!--[if !supportLists]--><span style=\\\"font-size: 14pt; font-family: &quot;Cambria Math&quot;, serif;\\\">1.<span style=\\\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\\\"font-size: 14pt; font-family: &quot;Cambria Math&quot;, serif;\\\">Explain the following processes (a) Techniques for Grubbing\r\nout roots and stumps <o:p></o:p></span></p><p class=\\\"MsoBodyText\\\" style=\\\"margin-left:.25in;text-align:justify\\\"><span style=\\\"font-size: 14pt; font-family: &quot;Cambria Math&quot;, serif;\\\">(b) Leveling the site. <o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\\\"MsoBodyText\\\" style=\\\"margin-left:.25in;text-align:justify;text-indent:\r\n-.25in;mso-list:l0 level1 lfo1;tab-stops:list .25in\\\"><!--[if !supportLists]--><span style=\\\"font-size: 14pt; font-family: &quot;Cambria Math&quot;, serif;\\\">2.<span style=\\\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\\\"font-size: 14pt; font-family: &quot;Cambria Math&quot;, serif;\\\">State the uses of three (3)\r\nmechanical tools used in site preparation</span></p><p class=\\\"MsoBodyText\\\" style=\\\"margin-left:.25in;text-align:justify;text-indent:\r\n-.25in;mso-list:l0 level1 lfo1;tab-stops:list .25in\\\"><span style=\\\"font-size: 14pt; font-family: &quot;Cambria Math&quot;, serif;\\\">3.&nbsp;&nbsp;</span><span style=\\\"font-size: 14pt; font-family: &quot;Cambria Math&quot;, serif;\\\"><o:p></o:p></span><span style=\\\"font-family: &quot;Cambria Math&quot;, serif; font-size: 14pt; text-align: left;\\\">What\r\nis setting out?</span></p>', '6', 1632219719, '6', '2021-09-21 14:21:59', '2021-09-21 14:21:59'),
(20, '12', '14', 13, 'HOLIDAY ASSIGNMENT', '<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;line-height:normal\\\"><span style=\\\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,serif\\\">GEOGRAPHY SSS 1<o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;line-height:normal\\\"><o:p>&nbsp;</o:p></p><p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;line-height:normal\\\"><o:p>&nbsp;</o:p></p><p class=\\\"MsoNormal\\\">1. Draw a comprehensive diagram showing the types of eclipse\r\nin your note.<o:p></o:p></p><p class=\\\"MsoNormal\\\">2. List five characteristics of the planet<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\\\"MsoNormal\\\">3. State five importance of geography<o:p></o:p></p>', '8', 1632226095, '8', '2021-09-21 16:08:15', '2021-09-21 16:08:15'),
(21, '13', '14', 13, 'HOLIDAY ASSIGNMENT', '<p class=\\\"MsoNormal\\\">1. Define plantation Agriculture<o:p></o:p></p><p class=\\\"MsoNormal\\\">2. State three characteristic of plantation Agriculture<o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\\\"MsoNormal\\\">3. Mention four crops produced in plantation Agriculture<o:p></o:p></p>', '8', 1632226165, '8', '2021-09-21 16:09:25', '2021-09-21 16:09:25'),
(22, '12', '14', 14, 'HOLIDAY ASSIGNMENT', '<p class=\\\"MsoNormal\\\">1. What is running water?<o:p></o:p></p><p class=\\\"MsoNormal\\\">2. State the stages of a river.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\\\"MsoNormal\\\">3. Explain the processes of river erosion.<o:p></o:p></p>', '8', 1632226228, '8', '2021-09-21 16:10:28', '2021-09-21 16:10:28'),
(23, '10', '13', 15, 'HOLIDAY ASSIGNMENT', '<p class=\\\"MsoNormal\\\">1. Define a crop<o:p></o:p></p><p class=\\\"MsoNormal\\\">2. Classify crop based on their life cycle with examples<o:p></o:p></p><p class=\\\"MsoNormal\\\">3. State three examples each of monocot and Dicot</p>', '8', 1632228252, '8', '2021-09-21 16:44:12', '2021-09-21 16:44:12');
