(24, '11', '13', 13, 'HOLIDAY ASSIGNMENT', '<p class=\\\"MsoNormal\\\">1. What is branding?<o:p></o:p></p><p class=\\\"MsoNormal\\\">2. List three advantage of branding<o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\\\"MsoNormal\\\">3. List two disadvantage of branding<o:p></o:p></p>', '8', 1632228292, '8', '2021-09-21 16:44:52', '2021-09-21 16:44:52'),
(25, '11', '10', 13, 'HOLIDAY ASSIGNMENT', '<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;line-height:normal\\\"><span style=\\\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,serif\\\">1. What are\r\npreservatives?</span><o:p></o:p></p><p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;line-height:normal\\\"><span style=\\\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,serif\\\">2. Mention four\r\nproperties of a good preservative.</span><o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;line-height:normal\\\"><span style=\\\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,serif\\\">3. Mention three\r\nmethods of applying preservatives.<o:p></o:p></span></p>', '8', 1632228353, '8', '2021-09-21 16:45:53', '2021-09-21 16:45:53'),
(26, '10', '5', 13, 'HOLIDAY ASSIGNMENT', '<p>1. Explain what you understand by the chemical, its classes based on uses and safety measures when using chemicals</p><p><br></p>', '14', 1632228647, '14', '2021-09-21 16:50:47', '2021-09-21 16:50:47'),
(27, '9', '5', 13, 'HOLIDAY ASSIGNMENT', '<p>1. Explain what you understand by friction</p><p>2. describe metals and the types of metals</p>', '14', 1632228801, '14', '2021-09-21 16:53:21', '2021-09-21 16:53:21'),
(28, '13', '26', 16, 'holiday assignment', '<p>1. Define catenation&nbsp;</p><p>2. What is homologous series?</p><p>3. Briefly explain cracking.</p><p>4. What is allotropy?</p>', '10', 1632477816, '10', '2021-09-24 14:03:36', '2021-09-24 14:03:36'),
(29, '11', '5', 1, 'holiday assignment', '<p>1. Define chemistry&nbsp;</p><p>2. Define Biology&nbsp;</p><p>3. Mention 3 uses of science&nbsp;</p><p>4. Mention &nbsp;4 branches of biology&nbsp;</p><p>5. Differentiate between physical and chemical changes</p>', '10', 1632479718, '10', '2021-09-24 14:35:18', '2021-09-24 14:35:18'),
(30, '13', '27', 2, 'holiday assignment', '<p>1. Define excretion&nbsp;</p><p>2. Explain nervous system&nbsp;</p><p>3. Mention 4 animal hormones and their uses</p>', '10', 1632479872, '10', '2021-09-24 14:37:52', '2021-09-24 14:37:52');

